css:
.nuclide-input-group.nuclide-input-group {
  display: flex;
}
.nuclide-input-group.nuclide-input-group > * {
  border-radius: 0;
}
.nuclide-input-group.nuclide-input-group > *:focus-within,
.nuclide-input-group.nuclide-input-group > *.is-focused {
  z-index: 2;
}
.nuclide-input-group.nuclide-input-group > * + * {
  margin-left: -1px;
}
.nuclide-input-group.nuclide-input-group > *:first-child {
  border-top-left-radius: 3px;
  border-bottom-left-radius: 3px;
}
.nuclide-input-group.nuclide-input-group > *:last-child {
  border-top-right-radius: 3px;
  border-bottom-right-radius: 3px;
}
.nuclide-input-group.nuclide-input-group > .atom-text-editor-sm > * {
  height: 19px !important;
}
.nuclide-input-group.nuclide-input-group > .atom-text-editor-sm > * .lines {
  transform: translateY(-1px);
}
.nuclide-input-group.nuclide-input-group > .atom-text-editor-sm > * .cursor {
  height: 17px !important;
  margin-top: 2px;
}
.nuclide-input-group.nuclide-input-group > .popover-list:not(:last-child) atom-text-editor {
  border-top-right-radius: 0;
  border-bottom-right-radius: 0;
}
.nuclide-input-group.nuclide-input-group > *:not(:first-child) > .btn:first-child {
  border-top-left-radius: 0;
  border-bottom-left-radius: 0;
}
